    }
     
    render(){ 
        
    
        
     
    
        return(
<ScrollView>
        <View  style={{backgroundColor: '#adf6d6',flex:1,justifyContent: 'center',alignItems: 'center'}}>
      
        <TouchableOpacity
            onPress={() => this.props.navigation.navigate('Login')}
            >
        <Image
            source={require('../../../../assets/TripLogo.png')}
            resizeMode="center"
            style={  {
    
                resizeMode: 'contain',
                width: 50,
                height: 50,
                marginTop:5
             
            }}
          />
          </TouchableOpacity>
        <TouchableOpacity onPress={()=>this.props.navigation.navigate('galataTower')} style={{position:'absolute',right:'85%',top:0}}>
    <Icon  name={Platform.OS === "ios" ? "ios-add" : "arrow-back-circle-outline"}
  //name={(this.state.hidePassword)?"eye-off-outlane:eye-outlane"}  şifre görünürlüğü açıp kapatma
  color="black"
  size={55}/>
</TouchableOpacity>
        <View style={{alignItems:'center'}}> 
   <Text style={{color:'black',fontSize:45,alignItems:'center',justifyContent:'center'}}>
     Galata Tower 
     </Text>
     </View>
         <Text style={{margin:25,fontSize:25,color:'black'}}>
             
             
             
          The Galata Tower (Turkish: Galata Kulesi), called Christea Turris (the "Tower of Christ" in Latin) by the Genoese, is a medieval stone tower in the Galata/Karaköy quarter of Istanbul, Turkey, just to the north of the Golden Horn's junction with the Bosphorus. It is a high, cone-capped cylinder that dominates the skyline and offers a panoramic vista of Istanbul's historic peninsula and its environs.
         
